// Dashboard.jsx
import Sidebar from "../components/Sidebar";
import Navbar from "../components/Navbar";
import Card from "../components/Card";

export default function Dashboard() {
    return (
        <div className="flex h-screen bg-gray-100 font-sans">
            <Sidebar />
            <div className="flex flex-row flex-wrap flex-1 flex-grow content-start pl-16">
                <Navbar />

                    <Card  value="$3249" label="Total Revenue" color="text-indigo-500" />
                    <Card  value="249" label="Total Users" color="text-indigo-500" />
                    <Card  value="2" label="New Users" color="text-indigo-500" />
                    <Card  value="152 days" label="Server Uptime" color="text-indigo-500" />
             
            </div>
        </div>
    );
}
